import { ReactTerminal } from "react-terminal";
import './App.css'


function App() {
    // Define commands here
    const commands = {
        whoami: "jackharper",
        cd: (directory) => `changed path to ${directory}`
    };

    return (
        <div className="App">
            <h1 className="title">FreezingKas</h1>
            <div className="terminal">
                <ReactTerminal
                    commands={commands}
                    theme="dark"
                    welcomeMessage="Welcome to the terminal!"
                />
            </div>
        </div>


    );

}

export default App;
